import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import KakaoLink from "./components/KakaoLink";

<link
  rel="stylesheet"
  href="https://fonts.googleapis.com/icon?family=Material+Icons"
/>

function App() {
  return (
    <div>
      <Header />
      <KakaoLink />
      <Footer />
    </div>
  );
}

export default App;
